       filt['rates'][i] = rate;\n        if ((key != 'F625W') && (key != 'F658N')) {\n            var k = i;\n            if (i > 2) { k = i - 2; }\n            for (j = 0; j < stats.length; j++) {\n                var detector;\n                if ((key == 'F475W') || (key == 'F814W')) {\n                    detector = 'ACS_WFC';\n                } else {\n                    detector = 'WFC3';\n                }\n                var flux_nd = data['logHST_' + detector + '_' + key + '_nd_' + stats[j]][inds];\n                var flux_wd = data['logHST_' + detector + '_' + key + '_wd_' + stats[j]][inds];\n                filt_f['flux_nd_'+stats[j]][k] = flux_nd;\n                filt_f['flux_wd_'+stats[j]][k] = flux_wd;\n            }\n        }\n    }\n    filters.trigger('change');\n    filters_flux.trigger('change');\n    var maxmag = Math.max(...mags);\n    var minmag = Math.min(...mags);\n    var yrange = maxmag - minmag;\n    if (minmag < 16) {\n        y_range.end = minmag-0.1*yrange;\n    } else {\n        y_range.end = 16;\n    }\n    if (maxmag > 28) {\n        y_range.start = maxmag+0.15*yrange;\n    } else {\n        y_range.start = 28;\n    }\n} else {\n    JS9.SetZoom('toFit');\n}\n\nreturn false;\n"},"id":"4d6e052d-1ac0-419b-bfa8-163edd84fcbd","type":"CustomJS"},{"attributes":{"callback":null,"column_names":["x","y"],"data":{"x":{"__ndarray__":"lM3qa6PWyT+a4J7SOGHRPznXXpenftU/pY6v4f1/3j+zexCkmAbkPz0WxBJlEuU/xwNLbYfV6T8PfumNGZnyP9XFzWlSoPg/2tMYixP//T8=","dtype":"float64","shape":[10]},"y":{"__ndarray__":"rk/Sia2gMUA66rT+YgkyQMEs/wRskzJA3HKSn4tBNEB5pB41TY80QOQc3t6weDRAgd9iL6++NEAQdL5UsRE1QLAh9j3dSjVAbhn609hgNUA=","dtype":"float64","shape":[10]}}},"id":"840394a2-2e20-47ee-9386-1fa0b92c5a70","type":"ColumnDataSource"},{"attributes":{"plot":{"id":"d1491b1d-4b62-47b5-bf3c-f5cf18cca47f","subtype":"Figure","type":"Plot"}},"id":"99b02af0-029b-4cd9-93ad-3e35eb4228a1","type":"WheelZoomTool"},{"attributes":{},"id":"58ae5de3-dbb1-472f-af50-d27325ca4a92","type":"To
